import * as React from "react";

interface InputProps {}

const Input: React.FunctionComponent<InputProps> = () => {
  return (
    <div className="input_container">
      <label htmlFor="in"></label>
      <input type="text" id="in" />
    </div>
  );
};

export default Input;
